import React from "react";
import Card from "./Card";
import Form from "./Form";
import background from "./imag.jpg"
function Home() {
  return (
    <div className="container my-12 mx-auto px-4 md:px-12" style={{ backgroundImage: `url(${background})` }}>
      <h1 className="text-center text-2xl italic font-medium text-blue-900 dark:text-black">Home page</h1>
      <br />
      <br />
      <br />

      <Form />
      {/* Cards */}
      <Card />
    </div>
  );
}
export default Home;
